contracts/charityDonation.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./verifier.sol";  // Use the generated verifier contract

contract CharityDonation is Ownable {
    IERC20 public usdcToken;
    address public charity;
    Groth16Verifier public zkVerifier;  // Verifier contract

    struct Donation {
        address donor;
        uint256 amount;
        bytes32 commitment;
    }

    mapping(address => Donation[]) public donations;
    uint256 public totalDonations;

    event DonationMade(address indexed donor, uint256 amount, bytes32 commitment);
    event Withdrawal(address indexed charity, uint256 amount);

    constructor(address _usdcToken, address _charity, address _verifier) Ownable(msg.sender) {
        require(_usdcToken != address(0), "Invalid USDC token address");
        require(_charity != address(0), "Invalid charity address");
        require(_verifier != address(0), "Invalid verifier address");

        usdcToken = IERC20(_usdcToken);
        charity = _charity;
        zkVerifier = Groth16Verifier(_verifier);
    }

    function donate(
        uint256 amount,
        uint256[2] calldata a, 
        uint256[2][2] calldata b, 
        uint256[2] calldata c, 
        uint256[1] calldata publicInputs  // Changed to expect 3 public inputs
    ) external {
        require(amount > 0, "Amount must be greater than zero");
        require(usdcToken.transferFrom(msg.sender, address(this), amount), "Transfer failed");

        // Verify zk-SNARK proof using the correct Verifier contract
        require(zkVerifier.verifyProof(a, b, c, publicInputs), "Invalid zk-SNARK proof");

        // Store donation commitment
        bytes32 commitment = keccak256(abi.encodePacked(publicInputs));
        donations[msg.sender].push(Donation(msg.sender, amount, commitment));

        totalDonations += amount;
        emit DonationMade(msg.sender, amount, commitment);
    }

    function withdraw(uint256 amount) external {
        require(msg.sender == charity, "Only the registered charity can withdraw");
        require(amount > 0 && amount <= usdcToken.balanceOf(address(this)), "Invalid withdraw amount");

        require(usdcToken.transfer(charity, amount), "Transfer failed");

        emit Withdrawal(charity, amount);
    }

    function getContractBalance() external view returns (uint256) {
        return usdcToken.balanceOf(address(this));
    }

    function setCharity(address newCharity) external onlyOwner {
        require(newCharity != address(0), "Invalid address");
        charity = newCharity;
    }
}

